This interface sits between a serial byte encoding component and a
framing/packetizing component. It is to be used with framing protocols
that place delimiters between frames. This interface separates the tasks
of interpreting and coding delimiters and escape bytes from the rest of
the wire protocol.

@author Philip Levis
@author Ben Greenstein
@date   August 7 2005

Used by the upper layer to request that a byte of data be sent
over serial.
@param data The byte to be sent
@return Returns an error_t code that indicates if the lower layer
has accepted the byte for sending (SUCCESS) or not (FAIL).

This is an interface that a serial framing protocol provides and a serial dispatcher uses. The call sequence should be as follows: The dispatcher should call startSend, specifying the first byte to send. The framing protocol can then signal as many nextBytes as it wants/needs, to spool in the bytes. It continues to do so until it receives a sendComplete call, which will almost certainly happen within a nextByte signal (i.e., re-entrant to the framing protocol).
This allows the framing protocol to buffer as many bytes as it needs to to meet timing requirements, jitter, etc.
@author Philip Levis @author Ben Greenstein @date August 7 2005

The dispatcher may initiate a serial transmission by calling this function
and passing the first byte to be transmitted.
@param first_byte The first byte to be transmitted.
@return Returns an error_t code indicating either that the framer
has the resources available to transmit the frame (SUCCESS) or
not (EBUSY).

This is the data interface that a serial protocol provides and
a serial dispatcher uses. The dispatcher expects the following pattern
of calls: ((startPacket)+ (byteReceived)* (endPacket)+)*
It should ignore any signals that do not follow this pattern.
The interface is used to separate the state machine of the wire protocol
from the complexities of dispatch.

